context.fillRect(0,0,width,height);
context.fillStyle = "white";
function predict() {
    var predicted = [];

    for (var i = 0; i < biases[0].length; i++) {
        var s = 0;
        for (var x = 0; x < 784; x++) {
            s += normalize(grid[x])*weights[0][i][x];
        }
        s += biases[0][i];
        predicted.push(s);
    }
    predicted = ReLU(predicted);
    second = [];
    for (var i = 0; i < biases[1].length; i++) {
        var s = 0;
        for (var x = 0; x < biases[0].length; x++) {
            s += predicted[x]*weights[1][i][x];
        }
        s += biases[1][i];
        second.push(s);
    }
    second = ReLU(second);
    third=[];
    for (var i = 0; i < biases[2].length; i++) {
        var s = 0;
        for (var x = 0; x < biases[1].length; x++) {
            s += second[x]*weights[2][i][x];
        }
        s += biases[2][i];
        third.push(s);
    }
    third = logSoftMax(third);
    return third;
}

function ReLU(data) {
    for (var i = 0; i < data.length; i++) {
        data[i] = Math.max(0, data[i]);
    }
    return data;
}
function logSoftMax(set) {
    var sum = 0;
    for (v of set) {
        sum += Math.pow(Math.E, v);
    }
    for (var x = 0; x < set.length; x++) {
        set[x] = Math.pow(Math.E, set[x]) / sum;
    }
    return set;
}
function normalize(n) {
return (n-0.1307) / 0.3081;
}
canvas.addEventListener("mousedown", (event)=> {
    mouseisdown = true;
    grid = [];
    for (var x = 0; x < gridx*gridy; x++) {
        grid.push(0);
    }    
});
canvas.addEventListener("mouseup", (event)=> {
    mouseisdown = false;

    context.fillStyle = "black";
    context.fillRect(0,0,width,height);
    context.fillStyle = "white";
    //shift();
    var p = predict();
    var str = "Predictions : ";
    for (var i = 0; i < 10; i++) {
        str += i + "=" + Math.round(p[i]*100)/100 + " "
    }
    str += "Most : " + p.indexOf(Math.max(...p));
    document.getElementById("digitLabel").innerHTML = str;
});
function getDims() {
    var lx = gridx;
    var ly = gridy;
    var hx = 0;
    var hy = 0;
    for (var i = 0; i < grid.length; i++) {
        if (0.3 < grid[i]) {
            lx = Math.min(lx, i%gridx);
            hx = Math.max(hx, i%gridx);
            ly = Math.min(ly, Math.floor(i/gridy)); 
            hy = Math.max(hy, Math.floor(i/gridy)); 
        }
    }

    return [lx, ly, hx, hy];
}
function shift() {
    var dimensions = getDims();
    var virtualArr = [];
    for (var i = 0; i < grid.length; i++) {
        virtualArr.push(0);
    }
    for (var i = 0; i < grid.length; i++) {
        if (0.3 < grid[i]) {
            virtualArr[i + (26-dimensions[2]) + gridx * (14-dimensions[1])] = grid[i];
        }
    }
    grid = virtualArr;
}
canvas.addEventListener("mousemove", (event)=> {
    if (mouseisdown) {
        const rect = canvas.getBoundingClientRect();
        const x = event.clientX - rect.left;
        const y = event.clientY - rect.top;
        lastPos = currentPos;
        currentPos = [x,y];
        addSpot(x,y);
    }
});
function addColor(gx, gy, n) {
    grid[gx+gy*gridy] = Math.min(grid[gx+gy*gridy]+n, 1);
    var v = 255*grid[gx+gy*gridy];
    context.fillStyle = `rgb(${v}, ${v}, ${v})`;
    context.fillRect(gx * width / gridx, gy * height / gridy, width / gridx, height / gridy)
}
function addSpot(x,y) {
    var gx = Math.floor(x/(width/gridx));
    var gy = Math.floor(y/(height/gridy));
    //console.log(`x : ${gx} y : ${gy}`);
    var dx = 0.04;
    addColor(gx,gy, 0.1);
    addColor(gx-1,gy-1, dx);
    addColor(gx,gy-1, dx);
    addColor(gx+1,gy-1, dx);
    addColor(gx-1,gy, dx);
    addColor(gx+1,gy, dx);
    addColor(gx-1,gy+1, dx);
    addColor(gx,gy+1, dx);
    addColor(gx+1,gy+1, dx);
}

function waitForValue(variable, value) {
    return new Promise((resolve) => {
        const interval = setInterval(() => {
            if (variable === value) {
                clearInterval(interval);
                resolve();
            }
        }, 100);
    });
}
